import React, { useState, useEffect } from "react";
import { getOrders } from "../../api/orders";

const Orders = () => {
  const [orders, setOrders] = useState();

  useEffect(() => {
    const data = getOrders(localStorage.getItem("token"));
    data.then((result) => {
      setOrders(result);
      console.log(result);
    });
  }, []);

  if (orders) {
    return (
      <div>
        <div>
          <div>Ждет подтверждения</div>
          <div>В работе</div>
          <div>Окончено</div>
        </div>
        <div>
          <div>
            {orders[0].map((order) => (
              <div>
                <div>
                  {order.date}, {order.in_work}, {order.is_completed},{" "}
                  {order.note}, {order.cell}
                </div>
                <div>
                  {order.data.map((orderInfo) => (
                    <div>
                      {orderInfo.super_type}/{orderInfo.type}/
                      {orderInfo.service} - {orderInfo.count}
                    </div>
                  ))}
                </div>
              </div>
            ))}
          </div>
          <div></div>
          <div></div>
        </div>
      </div>
    );
  }
};
export default Orders;
